import { createRouter, createWebHistory } from 'vue-router';

import HomeComponent from './views/HomeComponent.vue'; // Nome do componente ajustado
import LoginComponent from './components/LoginComponent.vue'; // Nome do componente ajustado
import ManageComponent from './components/ManageComponent.vue'; // Nome do componente ajustado

const routes = [
  { path: '/', component: HomeComponent },
  { path: '/login', component: LoginComponent },
  { path: '/manage', component: ManageComponent },
  // Adicione outras rotas conforme necessário
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
